
        <html lang="en">
            <head>
                <meta charset="UTF-8"/>
                <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
                <title>Proficiency Points</title>
                <style>
                    table {
                        width: 100%;
                        border-collapse: collapse;
                    }
                    th, td {
                        border: 1px solid #ddd;
                        padding: 2px;
                       // cursor: pointer; /* Add a pointer cursor to sortable headers */
                    }
                    th {
                        background-color: #f2f2f2;
                        vertical-align: bottom;
                        color: black; /* Default header color */
                    }
                    .filter-container {
                        display: flex;
                        flex-direction: column;
                        align-items: center;
                    }
                    .filter-container input, .filter-container select {
                        margin-top: auto;
                        width: 95%; /* Make sure inputs fit the column width */
                    }
                    .filter-input::placeholder {
                        font-size: 12px; /* Adjust the font size as needed */
                        color: #888; /* Optional: change the color of the placeholder text */
                        font-style: italic;
                    }

                    .center-align {
                        text-align: center;
                    }
                    .vertical-header {
                        writing-mode: horizontal-tb;
                        vertical-align: middle;
                        text-align: center;
                    }
                    .number-column {
                        max-width: 80px; /* Adjusting the width to fit 8 digits */
                        white-space: nowrap;
                    }
                    @media print {
                        .filters, .buttons, .filter-container {
                            display: none;
                        }
                    }
                </style>
            </head>
            <body>
                <h3>Proficiency classes and points for USA Dance athletes as of 2025-03-22</h3>

                <div class="buttons">
                    <button type="button" onclick="resetFilters()">Reset</button>
                </div>

                <table id="dataTable">
                    <thead>
                        <tr>
                            <th class="number-column">Number<br/>
                                <div class="filter-container">
                                    <input type="text" id="number" name="number" class="filter-input" placeholder="Type to filter" oninput="applyFilters()"/>
                                </div>
                            </th>
                            <th>Last Name<br/>
                                <div class="filter-container">
                                    <input type="text" id="lastName" name="lastName" class="filter-input" placeholder="Type to filter" oninput="applyFilters()"/>
                                </div>
                            </th>
                            <th>First Name<br/>
                                <div class="filter-container">
                                    <input type="text" id="firstName" name="firstName" class="filter-input" placeholder="Type to filter" oninput="applyFilters()"/>
                                </div>
                            </th>
                            <th>Standard Class<br/>
                                <div class="filter-container">
                                    <select id="standardClass" name="standardClass" onchange="applyFilters()"></select>
                                </div>
                            </th>
                            <th>Latin Class<br/>
                                <div class="filter-container">
                                    <select id="latinClass" name="latinClass" onchange="applyFilters()"></select>
                                </div>
                            </th>
                            <th>Smooth Class<br/>
                                <div class="filter-container">
                                    <select id="smoothClass" name="smoothClass" onchange="applyFilters()"></select>
                                </div>
                            </th>
                            <th>Rhythm Class<br/>
                                <div class="filter-container">
                                    <select id="rhythmClass" name="rhythmClass" onchange="applyFilters()"></select>
                                </div>
                            </th>
                            <th class="vertical-header">W</th>
                            <th class="vertical-header">T</th>
                            <th class="vertical-header">V</th>
                            <th class="vertical-header">F</th>
                            <th class="vertical-header">Q</th>
                            <th class="vertical-header">S</th>
                            <th class="vertical-header">C</th>
                            <th class="vertical-header">R</th>
                            <th class="vertical-header">P</th>
                            <th class="vertical-header">J</th>
                            <th class="vertical-header">AW</th>
                            <th class="vertical-header">AT</th>
                            <th class="vertical-header">AF</th>
                            <th class="vertical-header">AV</th>
                            <th class="vertical-header">AC</th>
                            <th class="vertical-header">AR</th>
                            <th class="vertical-header">B</th>
                            <th class="vertical-header">SW</th>
                            <th class="vertical-header">M</th>
                        </tr>
                    </thead>
                    <tbody>
                        <!-- Data rows will be added here by JavaScript -->
                    </tbody>
                </table>

                    function populateDropdowns() {
                        const standardClasses = new Set();
                        const latinClasses = new Set();
                        const smoothClasses = new Set();
                        const rhythmClasses = new Set();

                        let hasNoClassStandard = false;
                        let hasNoClassLatin = false;
                        let hasNoClassSmooth = false;
                        let hasNoClassRhythm = false;

                        data.forEach(item => {
                            if (item.standardClass) {
                                standardClasses.add(item.standardClass);
                            } else {
                                hasNoClassStandard = true;
                            }

                            if (item.latinClass) {
                                latinClasses.add(item.latinClass);
                            } else {
                                hasNoClassLatin = true;
                            }

                            if (item.smoothClass) {
                                smoothClasses.add(item.smoothClass);
                            } else {
                                hasNoClassSmooth = true;
                            }

                            if (item.rhythmClass) {
                                rhythmClasses.add(item.rhythmClass);
                            } else {
                                hasNoClassRhythm = true;
                            }
                        });

                        fillDropdown('standardClass', Array.from(standardClasses).sort(), hasNoClassStandard);
                        fillDropdown('latinClass', Array.from(latinClasses).sort(), hasNoClassLatin);
                        fillDropdown('smoothClass', Array.from(smoothClasses).sort(), hasNoClassSmooth);
                        fillDropdown('rhythmClass', Array.from(rhythmClasses).sort(), hasNoClassRhythm);
                    }

                    function fillDropdown(dropdownId, values, hasNoClass) {
                        const dropdown = document.getElementById(dropdownId);
                        dropdown.innerHTML = '<option value="All">All</option>';
                        values.forEach(value => {
                            const option = document.createElement('option');
                            option.value = value;
                            option.textContent = value;
                            dropdown.appendChild(option);
                        });

                        if (hasNoClass) {
                            const noClassOption = document.createElement('option');
                            noClassOption.value = 'No';
                            noClassOption.textContent = 'No Class';
                            dropdown.appendChild(noClassOption);
                        }
                    }

                    function applyFilters() {
                        const number = document.getElementById('number').value.toLowerCase();
                        const firstName = document.getElementById('firstName').value.toLowerCase();
                        const lastName = document.getElementById('lastName').value.toLowerCase();
                        const standardClass = document.getElementById('standardClass').value;
                        const latinClass = document.getElementById('latinClass').value;
                        const smoothClass = document.getElementById('smoothClass').value;
                        const rhythmClass = document.getElementById('rhythmClass').value;

                        const filteredData = data.filter(item => {
                            return (
                                (number === '' || item.number.toLowerCase().includes(number)) &&
                                (firstName === '' || item.firstName.toLowerCase().includes(firstName)) &&
                                (lastName === '' || item.lastName.toLowerCase().includes(lastName)) &&
                                (standardClass === 'All' || (item.standardClass === standardClass || (item.standardClass === '' && standardClass === 'No'))) &&
                                (latinClass === 'All' || (item.latinClass === latinClass || (item.latinClass === '' && latinClass === 'No'))) &&
                                (smoothClass === 'All' || (item.smoothClass === smoothClass || (item.smoothClass === '' && smoothClass === 'No'))) &&
                                (rhythmClass === 'All' || (item.rhythmClass === rhythmClass || (item.rhythmClass === '' && rhythmClass === 'No')))
                            );
                        });

                        const tableBody = document.getElementById('dataTable').getElementsByTagName('tbody')[0];
                        tableBody.innerHTML = '';

                        filteredData.forEach(item => {
                            const row = tableBody.insertRow();
                            row.innerHTML = `<td>${item.number}</td>
                                             <td>${item.lastName}</td>
                                             <td>${item.firstName}</td>
                                             <td class="center-align">${item.standardClass || ''}</td>
                                             <td class="center-align">${item.latinClass || ''}</td>
                                             <td class="center-align">${item.smoothClass || ''}</td>
                                             <td class="center-align">${item.rhythmClass || ''}</td>
                                             <td class="center-align">${item.w}</td>
                                             <td class="center-align">${item.t}</td>
                                             <td class="center-align">${item.v}</td>
                                             <td class="center-align">${item.f}</td>
                                             <td class="center-align">${item.q}</td>
                                             <td class="center-align">${item.s}</td>
                                             <td class="center-align">${item.c}</td>
                                             <td class="center-align">${item.r}</td>
                                             <td class="center-align">${item.p}</td>
                                             <td class="center-align">${item.j}</td>
                                             <td class="center-align">${item.aw}</td>
                                             <td class="center-align">${item.at}</td>
                                             <td class="center-align">${item.af}</td>
                                             <td class="center-align">${item.av}</td>
                                             <td class="center-align">${item.ac}</td>
                                             <td class="center-align">${item.ar}</td>
                                             <td class="center-align">${item.b}</td>
                                             <td class="center-align">${item.sw}</td>
                                             <td class="center-align">${item.m}</td>`;
                        });
                    }

                    function resetFilters() {
                        document.getElementById('number').value = '';
                        document.getElementById('firstName').value = '';
                        document.getElementById('lastName').value = '';
                        document.getElementById('standardClass').value = 'All';
                        document.getElementById('latinClass').value = 'All';
                        document.getElementById('smoothClass').value = 'All';
                        document.getElementById('rhythmClass').value = 'All';

                        applyFilters();
                    }

                    // Initial population of dropdowns and table
                    document.addEventListener('DOMContentLoaded', () => {
                        populateDropdowns();
                        applyFilters();
                    });
                </script>
            </body>
        </html>
